<form (ngSubmit)="updateTask()">
    <div class="container register">
        <div class="row">
            <div class="col-md-3 register-left">
                <!-- <img src="https://image.ibb.co/n7oTvU/logo_white.png" alt="" /> -->
                <h3>Welcome</h3>
                <p>You are 30 seconds away from earning your own money!</p>
                <!-- <input type="submit" name="" value="Login" /><br /> -->
            </div>
            <div class="col-md-9 register-right">
                <div class="tab-content" id="myTabContent">
                    <div class="tab-pane fade show active" id="home" role="tabpanel" aria-labelledby="home-tab">
                        <h3 class="register-heading">Edit Task</h3>
                        <div class="row register-form">
                            <div class="col-md-6">
                                <div class="form-group mb-3">
                                    <input type="number" class="form-control" placeholder="Id*" value="" name="id"
                                        [(ngModel)]="id" disabled=""/>
                                </div>
                                <div class="form-group mb-3">
                                    <input type="text" class="form-control" placeholder="Title*" value="" name="title"
                                        [(ngModel)]="title" />
                                </div>
                                <div class="form-group mb-3">
                                    <input type="text" class="form-control" placeholder="descriptions*" value=""
                                        name="description" [(ngModel)]="description" />
                                </div>
                            </div>
                            <div class="col-md-6">
                                <div class="mb-3">
                                    <label for="status" class="form-label">Status</label>
                                    <select class="form-select" id="status" name="status" name="status"
                                        [(ngModel)]="status" required>
                                        <option value="" disabled selected>Select Status</option>
                                        <option value="Pending">Pending</option>
                                        <option value="In Progress">In Progress</option>
                                        <option value="Completed">Completed</option>
                                    </select>
                                </div>
                                <div class="mb-3">
                                    <label for="date" class="form-label">Date</label>
                                    <input type="date" class="form-control" id="date" name="date" name="date"
                                        [(ngModel)]="date" required>
                                </div>
                                <input type="submit" class="btnRegister" value="Edit Task" />
                            </div>
                        </div>
                    </div>

                </div>
            </div>
        </div>
    </div>
</form>
